import styled from "styled-components";

export const NavbarContainer = styled.nav`
  display: flex;
  align-items: center;
  justify-content: space-between;
  background-color: #181d24;
  padding: 2.5% 20px;
  color: #ffffff;
`;

export const Logo = styled.img`
  width: 100px;
  height: auto;
`;
